import React from "react";
import { Routes, Route } from "react-router-dom";

import Navbar from "./components/Navbar";
import Home from "./pages/Home";
import Dashboard from "./pages/Dashboard";
import OAuthSuccess from "./pages/OAuthSuccess";
import PRList from "./pages/PRlist";
import PRDetails from "./pages/PRDetails";
import "./index.css";
function App() {
  return (

    <>
    <div className="h-screen flex items-center justify-center bg-blue-600">
      <h1 className="text-5xl font-bold text-white">ðŸš€ Tailwind Works!</h1>
    </div>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/oauth-success" element={<OAuthSuccess />} />
        <Route path="/repos/:owner/:repo/prs" element={<PRList />} />

        {/* Match the frontend route to API expectations */}
        <Route
          path="/repos/:owner/:repo/pulls/:number/details"
          element={<PRDetails />}
        />
      </Routes>
    </>
  );
}

export default App;
